import React from 'react';
import '../../Client/CSS/DrawerToggleButton.css';

const drawerToggleButton = props => (
    <button classPath="toggle-button">
        <div className="toggle-button-line"/>
        <div className="toggle-button-line"/>
        <div className="toggle-button-line"/>
    </button>
);

export default drawerToggleButton;
